<!DOCTYPE html>
<html>
<head>
	<title>Documentacion</title>
	<style type='text/css'>
		html {
			box-sizing: border-box;
			background: rgba(0, 0, 0, .1);
		}

		*,
		*:before,
		*:after {
			box-sizing: inherit;
		}

		body {
			background: #FFFFFF;
			display: grid;
			max-width: 1024px;
			margin: 0 auto;
			padding: 6px 12px;
			grid-template-areas: "head head"
				"nav tabs"
				"nav main"
				"nav none";
			grid-template-columns: 1fr 3fr;
			grid-template-rows: auto auto calc(100vh - 100px);
			font-family: Arial;
		}

		header {
			grid-area: head;
			text-align: left;
			font-size: small;
			font-family: Arial;
		}

		.content_oculto {
			display: none;
		}

		.content_visible {
			display: flex;
			overflow-x: scroll;
		}

		.tab_seleccionada {
			background-color: #FFFFFF;
			border-right: #000000 1px solid;
		}

		.tab_deseleccionada {
			background-color: #cccccc;
			border-right: #000000 1px solid;
		}

		nav {
			grid-area: nav;
			padding: 0 20px 0 10px;
		}

			nav p {
				margin: 0;
			}

			nav h4 {
				margin-bottom: 0;
			}

		main {
			grid-area: main;
			display: flex;
			flex-direction: column;
			flex-grow: 3;
		}

		.content {
			clear: both;
			border: #000000 1px solid;
			background-color: #ffffff;
		}

		textarea {
			resize: none;
		}

		table.blueTable {
			border: 1px solid #454545;
			background-color: #EEEEEE;
			text-align: left;
			border-collapse: collapse;
			font-family: Arial;
		}

			table.blueTable td,
			table.blueTable th {
				border: 1px solid #AAAAAA;
				padding: 3px 3px;
			}

			table.blueTable tbody td {
				font-size: 13px;
			}

			table.blueTable tr:nth-child(even) {
				background: #ffffff;
			}

			table.blueTable thead {
				background: #454545;
				border-bottom: 2px solid #444444;
			}

				table.blueTable thead th {
					font-size: 15px;
					font-weight: bold;
					color: #FFFFFF;
				}

			table.blueTable tfoot {
				font-size: 14px;
				font-weight: normal;
				color: #444444;
				background: #444444;
				border-top: 2px solid #444444;
			}

				table.blueTable tfoot td {
					font-size: 14px;
				}

				table.blueTable tfoot .links {
					text-align: center;
				}

					table.blueTable tfoot .links a {
						display: inline-block;
						background: #454545;
						color: #FFFFFF;
						padding: 2px 8px;
						border-radius: 5px;
					}

		#tabco4 {
			background-color: #EEEEEE;
			list-style-type: none;
			display: flex;
			grid-area: tabs;
			margin-bottom: 0;
		}

			#tabco4 li {
				float: left;
			}

			#tabco4 a {
				text-decoration: none;
				display: block;
				padding: 5px 10px;
				cursor: pointer;
				font: bold 13px arial, sans-serif;
				color: rgb(0, 0, 0);
			}

				#tabco4 a:hover {
					color: #0000ff;
				}

		#MosIma {
			width: auto;
			height: auto;
			object-fit: contain;
		}

		#Mostext {
			flex-grow: 1;
		}

		#contenidos {
			display: grid;
			flex-grow: 1;
			overflow-y: scroll;
		}

		#botones_secuencia {
			display: flex;
			flex-direction: row;
		}

			#botones_secuencia button {
				flex-grow: 1;
			}
	</style>

	<!-- Fin Style -->

	<script type='text/javascript'>

		window.onload = function () {
			changeTab(0);
		}

		function changeTab(currentTab) {
			var main = $('contenidos')
			var tabs = $$($('tabco4'), 'li'); // cada uno de los tabs
			var tmpContents = $$(main, 'div');  // cada uno de los contenidos
			var contents = [];

			// filtro los divs para quedarme solo con los que est�n directamente bajo del main
			for (var i = 0; i < tmpContents.length; i++) {
				if (tmpContents[i].parentNode === main) {
					contents.push(tmpContents[i]);
				}
			}

			if (contents.length != tabs.length) {
				console.error("La lista de tabs y divs de contenido es de diferente tama�o. Revisar estructura del HTML y recargar.", contents, tabs);
				return;
			}

			for (var i = 0; i < tabs.length; i++) {
				if (currentTab != i) {
					contents[i].className = "content_oculto";
					tabs[i].className = "tab_deseleccionada";
				} else {
					contents[i].className = "content_visible";
					tabs[i].className = "tab_seleccionada";
				}
			}
		}

		function $(id) { return (document.getElementById(id)); }
		function $$(e, tag) { return e.getElementsByTagName(tag); }

	</script>

	function ClickRegistro() {
		var lista = document.getElementById('RegistroList');
		NRegistro = lista.selectedIndex;
		var i;
		var Pinforme, Pregistro;

		for(i = 0; i <= SecuenciaReg.length-1; i++) {
			Pinforme = SecuenciaReg[i][0];
			Pregistro = SecuenciaReg[i][1];
			if ((Pinforme == Ninforme) &&  (Pregistro == NRegistro)){
				IndiceSecuencia = i;
			}
		}
		MostrarRegistro();
	}

	function MostrarRegistro(){
		SetInfoResumen();
		MostrarTexto();
		MostrarTabla();
		MostrarImagen();
		MostrarDescripcionTabla();
	}

	function MostrarDescripcionTabla(){
		var lista = document.getElementById('DescripTabla');
		lista.innerHTML = TablaRegDescr[NRegistro];
	}

	function ClickAnterior(){
		IndiceSecuencia = IndiceSecuencia -1;
		if (IndiceSecuencia < 0){
			IndiceSecuencia = 0;
		};
		Ninforme = SecuenciaReg[IndiceSecuencia][0];
		CargarListadoRegistros();
		NRegistro = SecuenciaReg[IndiceSecuencia][1];
		MostrarRegistro();
	}

	function ClickSiguiente(){
		IndiceSecuencia = IndiceSecuencia +1;
		if (IndiceSecuencia > SecuenciaReg.length-1){
			IndiceSecuencia = SecuenciaReg.length-1;
		};
		Ninforme = SecuenciaReg[IndiceSecuencia][0];
		CargarListadoRegistros();
		NRegistro = SecuenciaReg[IndiceSecuencia][1];
		MostrarRegistro();
	}


	function removeOptions(selectElement) {
		var i, L = selectElement.options.length - 1;
		for(i = L; i >= 0; i--) {
			selectElement.remove(i);
		}
	}

	function SetInfoResumen(){
		var resumen = document.getElementById('DatoReg');
		var texto = "Informe "
		var Fecha = document.getElementById('FechaReg');
		resumen.innerHTML = texto.concat( Ninforme, " Reg: ", NRegistro );
		Fecha.innerHTML = FechaReg[NRegistro];
	}

	function MostrarTexto(){
		var texto = document.getElementById('Mostext');
		texto.innerHTML = TextoReg[NRegistro];
	}

	function MostrarTabla(){

        createTable(TablaReg[NRegistro]);
	}
	function MostrarImagen(){
		var IniImg = "data:image/png;base64,";
		var imag = document.getElementById('MosIma');
		if (ImagenReg[NRegistro] != "" ){
			imag.src = IniImg.concat(ImagenReg[NRegistro]);
		}else{
			imag.src = IniImg.concat("iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==");
		};
	}

	function createTable(tableData) {
		var tableViejo = document.getElementById('TablaHead');
		var tableBodyViejo = document.getElementById('TablaBody');

		var table = document.createElement('table');
		var tableBody = document.createElement('tbody');

		//borro todo:
		var rows = table.rows;

		tableData.forEach(function(rowData) {
			var row = document.createElement('tr');

			rowData.forEach(function(cellData) {
				var cell = document.createElement('td');
				cell.appendChild(document.createTextNode(cellData));
				row.appendChild(cell);
			});

			tableBody.appendChild(row);
		});

		//table.appendChild(tableBody);
		tableBodyViejo.parentNode.replaceChild( tableBody, tableBodyViejo);
		tableBody.id = "TablaBody";
		//document.body.appendChild(table);
	}



</script>
